import React from 'react';
// import '../styles/home.css'
function Charform() {
  return (
    <div className='charform' >
    <form>
        <label>
            Name:
            <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
    </form>   
    </div>
  )
}

export default Charform
